import { View, Text, TouchableOpacity } from 'react-native'

export default function TelaInicial(){
    return(
        <View>
            <TouchableOpacity>
                <Text>Sou cliente</Text>
            </TouchableOpacity>

            <TouchableOpacity>
                <Text>Sou cliente</Text>
            </TouchableOpacity>
        </View>
    )
}
